// src/App.js

import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import ProductList from './components/ProductList';
import SearchBar from './components/SearchBar';
import './App.css';

const App = () => {
  const [products, setProducts] = useState([]);
  const [filteredProducts, setFilteredProducts] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/products')
      .then((response) => response.json())
      .then((data) => {
        setProducts(data);
        setFilteredProducts(data);
      })
      .catch((error) => console.error('Error al obtener productos:', error));
  }, []);

  const handleSearch = (query) => {
    if (!query) {
      setFilteredProducts(products);
    } else {
      const filtered = products.filter((product) =>
        product.name.toLowerCase().includes(query.toLowerCase())
      );
      setFilteredProducts(filtered);
    }
  };

  return (
    <Router>
      <div>
        <header>
          <h1>Mi Sitio de E-commerce</h1>
        </header>
        <nav>
          <Link to="/">Inicio</Link>
          <Link to="/acerca-de">Acerca de</Link>
          <Link to="/contacto">Contacto</Link>
          <Link to="/productos">Productos</Link>
          <Link to="/carrito">Carrito</Link>
          <Link to="/pagar">Pagar</Link>
        </nav>
        <Routes>
          <Route exact path="/" element={<h2>Bienvenido a Mi Sitio de E-commerce</h2>} />
          <Route path="/acerca-de" element={
            <div>
              <h2>Acerca de</h2>
              <p>Información sobre nuestro sitio.</p>
            </div>
          } />
          <Route path="/contacto" element={
            <div>
              <h2>Contacto</h2>
              <p>Información de contacto.</p>
            </div>
          } />
          <Route path="/productos" element={
            <div>
              <SearchBar onSearch={handleSearch} />
              <ProductList products={filteredProducts} />
            </div>
          } />
          <Route path="/carrito" element={
            <div>
              <h2>Carrito</h2>
              <p>Tu carrito de compras.</p>
            </div>
          } />
          <Route path="/pagar" element={
            <div>
              <h2>Pagar</h2>
              <p>Proceso de pago.</p>
            </div>
          } />
        </Routes>
        <footer className="footer">
          <p>2024 Mi Sitio de E-commerce</p>
        </footer>
      </div>
    </Router>
  );
};

export default App;
